import './App.css';
import { Header } from './components/Header';
import { MoviesList } from './components/MoviesList';
import { HeaderContainer } from './styles/HeaderContainer';
import { MoviesContainer } from './styles/MoviesContainer';

function App() {
  return (
    <div className="App">
      <HeaderContainer>
        <Header/>
      </HeaderContainer>

      <MoviesContainer>
        <MoviesList movies={[]}/>
      </MoviesContainer>

    </div>
  );
}

export default App;
